import React from "react";
import { Map, MapContainer } from "google-maps-react";

const mapStyles = {
  width: "100%",
  height: "100%",
};

const Home = () => {
  return (
    <Map
      google={this.props.google}
      zoom={8}
      style={mapStyles}
      initialCenter={{ lat: 47.444, lng: -122.176 }}
    />
  );
};
export default Home({
  apiKey: "REACT_APP_GOOGLE_MAPS_API_KEY",
})(MapContainer);
